def get_game(start_revealed):
    output_game = ["------", "------", "------", "------", "------", "------" ]
    random_game = random.choice(all_possible_games)
    i = 0

    while i < start_revealed:
        x = random.randint(0,5)
        y = random.randint(0,5)

        random_line = random_game[x]
        output_line = output_game[x]

        if random_line[y] == "O":
            output_game[y] = output_game[y][:x] +  "O" + output_game[y][x + 1:]
        else:
            output_game[y] = output_game[y][:x] +  "X" + output_game[y][x + 1:]

        i += 1

    return_game = "\n".join(output_game)
    return_game = return_game.replace("-", ":white_medium_square:")
    return_game = return_game.replace("O", ":radio_button:")
    return_game = return_game.replace("X", ":cross_mark_button:")


    return_game = emoji.emojize(return_game)

    return return_game


def assemble_games():
     easy_game = get_game(15)
     medium_game = get_game(11)
     hard_game = get_game(8)

     tweet_body = "Easy: \n" + easy_game + "\n\nMedium: \n" + medium_game + "\n\nHard: \n" + hard_game

     return tweet_body

def tweet_game():
     tweet = assemble_games()
     status = api.update_status(tweet)
     print(status.id)
     # print(tweet)




tweet_game()
